import React from 'react'
import { Link } from 'react-router-dom'
import axios from 'axios';

/*export default function HomePage() {
  return (
    <div className="container">
      <h1>Home Page</h1>
      <p>
        <Link to="/taniarascia">taniarascia</Link> on GitHub.<br />
        <Link to="/2">id of 2</Link> on property api.
      </p>
    </div>
  )
}*/

export default class PersonList extends React.Component {
  state = {
    persons: []
  }

  componentDidMount() {
    //axios.get(`https://jsonplaceholder.typicode.com/users`)
    axios.get('https://api.redonemedia.co.uk/_/items/property')
      .then(res => {
        const persons = res.data;
        this.setState({ persons });
      })
  }

  render() {
    return (
      <ul>
        { this.state.persons[0].map(persons => <li key={persons.id}>{persons.name}</li>)}
      </ul>
    )
  }
}
